structScenarioResults.(sVersion).(sScenario).M_ = M_;
if exist('structScenarioResults.mat', 'file')
save('structScenarioResults.mat', 'structScenarioResults', '-append')
else
save('structScenarioResults.mat', 'structScenarioResults')
end
